INSERT INTO `soal` (`id_soal`, `id_mapel`, `nomor`, `soal`, `jenis`, `pilA`, `pilB`, `pilC`, `pilD`, `pilE`, `jawaban`, `file`, `file1`, `fileA`, `fileB`, `fileC`, `fileD`, `fileE`) VALUES
	(1, 4, 1, 'Tujuan penciptaan langit dan bumi serta pergantian siang dan malam menurut Q.S Al Imran : 190. Adalahâ€¦.', 1, 'Membuktikan bahwa Allah Swt itu maha adil dan perkasa', 'Membuktikan tentang tauhid, keesaan, dan kekuasaan Allah Swt', 'Membuktikan tentang kekuatan Allah dan manusia', 'Memberikan inspirasi untuk masuk agama Islam', 'Mencontohkan orang â€“ orang yang soleh', 'B', '', '', '', '', '', '', ''),
	(2, 4, 2, 'Orang yang mampu berpikir kritis termasuk â€¦..', 1, 'Ulul azmi', 'Ulul  Albab', 'Ikhlas', 'Al Amin', 'Qona\'ah', 'B', '', '', '', '', '', '', ''),
	(3, 4, 6, 'Dalam surat luqman ayat 14, Allah Swt menginformasikan bahwa ibu menyapih anaknya pada usia...', 1, '2 Tahun', '3 Tahun', '4 Tahun', '5 Tahun', '1 Tahun', 'A', '', '', '', '', '', '', ''),
	(4, 4, 7, 'Â Â Â  Setelah manusia meninggal dunia, mereka berada di alam pembatasan antara dunia dan akhirt yang disebutâ€¦.', 1, 'Barzakh', 'Mahsyar', 'Ba\'as', 'Hisab', 'Jaza', 'A', '', '', '', '', '', '', ''),
	(5, 4, 11, 'Pengorbanan seorang ibu untuk seorang anak yang dikisahkan dalam surah luqman ayat 14 yaituâ€¦', 1, 'Melahirkan dengan susah payah', 'Mengandung dalam keadaan lemah', 'Mendidiknya dengan sunguh- sungguh', 'Menyusui hingga anak berusia dua tahun', 'Terjaga setiap malam untuk menjaga anak', 'B', '', '', '', '', '', '', ''),
	(6, 4, 12, 'Iman kepada hari akhir / Kiamat adalah rukun iman keâ€¦.', 1, 'Satu', 'Dua', 'Tiga', 'Empat', 'Lima', 'D', '', '', '', '', '', '', ''),
	(7, 4, 13, 'Peristiwa berikut yang merupkan kiamat kubraâ€¦', 1, 'Gunung meletus', 'Gempa', 'Tsunami', 'Banjir', 'Musnahnya alam smesta', 'E', '', '', '', '', '', '', ''),
	(8, 4, 14, 'Hari pembalasan amal manusia disebut yaumulâ€¦', 1, 'Hisab', 'Jaza', 'Mizan', 'Ba\'ts', 'Hasyr', 'B', '', '', '', '', '', '', ''),
	(9, 4, 15, 'Tanda- tanda kiamat ada yang besar dan ada yang kecil. Berikut ini tanda - tanda yang besar, kecualiâ€¦.', 1, 'Munculnya dajjal', 'Matahari terbit dari barat', 'Banyak terjadi gempa bumi', 'Turunnya Nabu Isa', 'Lahirnya Imam Mahdi', 'C', '', '', '', '', '', '', ''),
	(10, 4, 16, 'Kehidupan yang hakiki adalah kehidupan diâ€¦.', 1, 'Dunia', 'Akhirat', 'Langit', 'Alam kubur', 'Alam barzah', 'B', '', '', '', '', '', '', ''),
	(11, 4, 17, 'Hari kiamat juga disebut yaum al qiyamah yaitu hariâ€¦.', 1, 'Penegakan keadilan', 'Yang paling akhir', 'Kegoncangan', 'Ancaman', 'Hari penimbangan', 'A', '', '', '', '', '', '', ''),
	(12, 4, 18, 'Sesungguhnya, pada penciptaan langit dan bumi ada tanda kekuasaan Allah bagi orang yangâ€¦.', 1, 'Berakal', 'Sombong', 'Ingkar', 'Berbudaya', 'Berbudi', 'A', '', '', '', '', '', '', ''),
	(13, 4, 19, 'Secara garis besar surah Al Imran ayat 190 - 191 menjelaskan tentangâ€¦.', 1, 'Musyawarah', 'Perilaku jujur', 'Husnuzan', 'Berpikir kritis', 'Sikap demokratis', 'D', '', '', '', '', '', '', ''),
	(14, 4, 20, 'Allah menjelaskan kepada kita bahwa sesungguhnya dalam penciptaan langit dan bumi, dan silih bergantinya siang dan malam terdapat tanda- tanda bagi orang yangâ€¦.', 1, 'Munafik', 'Jujur', 'Berakal', 'Bertaqwa', 'Beriman', 'C', '', '', '', '', '', '', ''),
	(15, 4, 23, 'Dalam Surah Luqman ayat 13, dijelaskan bahwa menyembah kepada selain Allah SWT  termasuk perbuatan...', 1, 'Syirik', 'Zholim', 'Sesat', 'Bid\'ah', 'Laknat', 'B', '', '', '', '', '', '', ''),
	(16, 4, 26, 'Surah at Takwir ayat 1 menjelaskan bahwa saat hari kiamat matahari akanâ€¦', 1, 'Digulung', 'Padam', 'Meledak', 'Menimpa bumi', 'Hancur berkeping- keping', 'A', '', '', '', '', '', '', ''),
	(17, 4, 27, 'Roh seorang mukmin setelah meninggal dunia akan berada diâ€¦.', 1, 'Surga', 'Neraka', 'Alam barzah', 'Alam akhirat', 'Alam gaib', 'C', '', '', '', '', '', '', ''),
	(18, 4, 28, 'Setelah dibagkitkan dari kematian, manusia akan dikumpulkan diâ€¦', 1, 'Pintu surga', 'Pintu neraka', 'Alam barzah', 'Padang mahsyar', 'Sirat mustaqim', 'D', '', '', '', '', '', '', ''),
	(19, 4, 29, 'Arti â€œ ulil albab â€œ adalah...', 1, 'Umat Islam', 'Orang dewasa', 'Umat terdahulu', 'Orang yang berfikir', 'Orang dewasa', 'D', '', '', '', '', '', '', ''),
	(20, 4, 30, 'Orang yang menasehati juga harus memberiâ€¦â€¦', 1, 'Teladan', 'Sedekah', 'Saran', 'santunan', 'Pekerjaan', 'A', '', '', '', '', '', '', ''),
	(21, 4, 31, 'Q.S. Lauqman ayat ke 12 menjelaskan bahwa Luqmanul-hakim mendapatkan keistimewaan dari Alloh berupa Al-Hikmah, Al-Hikmah yang dimaksud pada ayat tersebut adalah â€¦.', 1, 'Orang yang Sabar', 'Orang yang bersyukur', 'Orang yang Jujur', 'Orang yang Soleh', 'Orang yang Taqwa', 'B', '', '', '', '', '', '', ''),
	(22, 4, 32, 'Kisah-kisah yang melatarbelakangi turun salah satu ayat Al-Qur\'an disebut dengan â€¦.', 1, 'Asbabul Kisoh', 'Asbabut Tarikh', 'Asbabun Nuzul', 'Asbabul Wurud', 'Asbabul Fatwa', 'C', '', '', '', '', '', '', ''),
	(23, 4, 33, 'Kisah-kisah yang melatarbelakangi turun salah satu Hadits Rosul disebut dengan â€¦.', 1, 'Asbabul Kisoh', 'Asbabut Tarikh', 'Asbabun Nuzul', 'Asbabul Wurud', 'Asbabul Fatwa', 'D', '', '', '', '', '', '', ''),
	(24, 4, 34, 'Jika dalam bacaan Al-Qu\'an menemukan lafad ALLOH dan kata sebelumnya berharokah kasroh maka pada ilmu tajwid disebut â€¦.', 1, 'Takbir', 'Tahqiq', 'Tahmid', 'Tafhim', 'Tarjih', 'B', '', '', '', '', '', '', ''),
	(25, 4, 35, 'Jika dalam bacaan Al-Qu\'an menemukan lafad ALLOH dan kata sebelumnya berharokah Fathah atau Dhomah maka pada ilmu tajwid disebut â€¦.', 1, 'Takbir', 'Tahqiq', 'Tahmid', 'Tafhim', 'Tarjih', 'D', '', '', '', '', '', '', ''),
	(26, 4, 36, 'Dibawah ini yang bukan termasuk kaidah-kaidah mad thobi\'I adalah â€¦', 1, 'Mad Thobi\'i Juga bisa disebut Mad Asli', 'Mad Thobi\'i terdiri dari 3 huruf yaitu alif, wau, dan ya\'', 'memiliki bobot bacaan sampai dengan 2 harokat', 'jika alif sukun sebelunya berharokat fathah', 'jika wau sukun sebelumnya berharokat Kasroh', 'E', '', '', '', '', '', '', ''),
	(27, 4, 37, 'Dalam kaidah membaca Al-Qur\'an harus memperhatikan makhorijul huruf dan tanda berhenti bacaan yang disebut dengan', 1, 'Waqof', 'Tasdid', 'Sukun', 'Fathah', 'Tanwin', 'A', '', '', '', '', '', '', ''),
	(28, 4, 38, 'Jika Mad asli dibaca 6 harkat pada akhir ayat disebut dengan â€¦.', 1, 'Mad Iwad', 'Mad Arid li Sukun', 'Mad Badal', 'Mad Thobi\'i', 'Mad Silah Thowilah', 'B', '', '', '', '', '', '', ''),
	(29, 4, 39, 'Jika dalam bacaan Al-Qu\'an menemukan huruf qolqolah ditengah kalimah maka pada ilmu tajwid disebut â€¦.', 1, 'Qolqolah tahlifi', 'Qolqolah \'ainy', 'Qolqolah Kubra\'', 'Qolqolah Sugra\'', 'Qolqolah Khalqi', 'D', '', '', '', '', '', '', ''),
	(30, 4, 40, 'Jika dalam bacaan Al-Qu\'an menemukan huruf qolqolah di akhir kalimah maka pada ilmu tajwid disebut â€¦.', 1, 'Qolqolah tahlifi', 'Qolqolah \'ainy', 'Qolqolah Kubra\'', 'Qolqolah Sugra\'', 'Qolqolah Khalqi', 'C', '', '', '', '', '', '', ''),
	(31, 2, 2, '<p>&nbsp;&nbsp;&nbsp;&nbsp; Kitab Al-Qur&rsquo;an berfungsi membenarkan kitab-kitab sebelumnya ,yakni taurat yang di turunkan kepada Nabi Musa a,s,Zabur yang diturunkan Kepada Nabi Daud a.s dan Injil yang di turunkan Kepada Nabi Isa a.s Al-Qur&rsquo;an menjadi saksi atas kebenaran kandungan kitab-kitab terdahulu Dalam hal ini Al_Qur&rsquo;an berfungsi sebagai</p>', 1, '<p>Muhaimin</p>', '<p>Mutakabir</p>', '<p>Mutawatir</p>', '<p>Mursyid</p>', '<p>Murabbi</p>', 'D', '', '', '', '', '', '', ''),
	(32, 2, 3, 'Umat islam di perintahkan untuk berlomba-lomba dengan sungguh-sungguh dalam berbuat kebaikan dan menghindari perdebatan yang tidak perlu hingga menghabiskan waktu sia-sia .Berikut ini yang bukan merupakan hambatan dalam menerapkan fastabiqul khairat adalah', 1, 'Kurang ilmu untuk memahami  isi Al-Qur\'an ', 'Merasa diri paling benar dan menganggap pihak lain sesat', 'Memiliki pendirian yang teguh dan konsisten ', 'Merasa cukup dengan amal yang dilakukan', 'tidak mau menerima nasihat dari orang lain', 'D', '', '', '', '', '', '', ''),
	(33, 2, 4, 'Islam sangat Menghargai seseorang yang bekerja keras untuk memperoleh penghidupan yang layak ,dan mengkonsumsi makanan dari hasil usahanya sendiri ,bagi seorang muslim ,etos kerja bukan hanya bertujuan memenuhi kebutuhan hidup duniawi ,tetapi ada tujuan mulia yakni', 1, 'Mencapai pangkat tertinggi', 'Memperoleh harta yang melimpah', 'Sebagai bagian ibadah kepada Allah SWT', 'di muliakan oleh masyarakat', 'Mendapatkan ketenangan hidup', 'C', '', '', '', '', '', '', ''),
	(34, 2, 5, 'Bekerja keras merupakan perilaku mulia yang harus dilakukan setiap muslim .diantara tujuan bekerja dalam islam adalah menolak kemungkaran ,kemungkaran dapat terjadi pada seseorang yang menganggur ,kemungkaran terebut adalah', 1, 'Memiliki cita-cita yang terlalu tinggi', 'Rasa malas dan berpangku tangan ', 'Sulit membedakan antara kebaikan dan keburukan', 'Mendapatkan sumbangan dari orang lain', 'Tergerak untuk memperbanyak ibadah', 'D', '', '', '', '', '', '', ''),
	(35, 2, 6, 'Seandainya Allah Swt,menghendaki ,Niscaya umat Nabi Musa a.s ,Nabi a.s dan umat Nabi Muhamad Saw.akan dijadikan satu umat saja.Tetapi hal ini tidak dikehendaki oleh Allah Swt .Hikmah yang dapat di ambil adalah', 1, 'Manusia memiliki nasib berbeda-beda', 'Agar berlomba dalam kebaikan', 'Terciptanya kehidupan yang baru di bumi', 'Memperluas kewenangan manusia dalam mengolah bumi', 'Semua manusia dikendalikan oleh takdir', 'D', '', '', '', '', '', '', ''),
	(36, 2, 7, 'Iman islam dan ihsan adalah satu kesatuan yang tidak bisa di pisahkan yang kemudian disebut dengan agama islam .Berikut ini yang merupakan pengertian dari iman adalah', 1, 'Mempercayai dengan hati,mengucapkan dengan lisan dan meragukan dengan perbuatan', 'Mempercayai setengah hati ,mengucapkan dengan lisan dan meragukan dengan perbuatan', 'Mempercayai dengan hati ,mengucapkan dengan lisan dan membuktikan dengan perbuatan', 'Mempercayai dengan hati ,menolak dengan ucapan dan membuktikan dengan perbuatan', 'Mempercayai dengan hati ,menyangkal dengan lisan dan membuktikan dengan perbuatan', 'C', '', '', '', '', '', '', ''),
	(37, 2, 8, 'Seorang mukmin adalah seorang yang beriman yang melaksanakan ibadah dengan sangat ikhlas ,seakan-akan Allah Swt,melihatnya meskipun ia tidak melihat Allah Swt.Pernyataan tersebut merupakan definisi dari ', 1, 'Ihsan ', 'Iman', 'Islam', 'Ikhlas', 'Istisab', 'B', '', '', '', '', '', '', ''),
	(38, 2, 9, 'Dimensi dari keimanan itu menyangkut tiga ranah yaitu ma\'rifatun bil qalbi ,iqrarun bil lisan dan amalun bilarkan.dari contoh-contoh amalan dibawah ini yang merupakan cabang iman dalam ranah ma\'rifatun bilqalbi adalah', 1, 'belajar dan menuntut ilmu', 'membaca kalimat thayyibah', 'membaca kitab suci Al-Qur\'an ', 'mengajarkan ilmu kepadaorang lain', 'Mencintai dan membenci karena Allah Swt', 'E', '', '', '', '', '', '', ''),
	(39, 2, 10, 'Beriman pada hakikatnya adalah satu padunya niat,ucapan dan perbuatan ,Berikut ini yang bukan merupakan cabang iman dari ranah perbuatan adalah', 1, 'Mengurus perawatan jenazah', 'Menghindari bacaan yang sia-sia', 'menunaikan dan membayar hutang ', 'meluruskan muamalah dan menghindari riba ', 'menjadi saksi yang adil dan tidak menutupi kebenaran', 'B', '', '', '', '', '', '', ''),
	(40, 2, 11, 'Berikut ini yang bukan merupakan tanda-tanda orang yang beriman adalah', 1, 'istiqomah dan tertib menjalankan salatnya', 'bila di sebutkan nama Allah swt hatinya bergetar', 'menafkahkan sebagian hartanya di jalan Allah swt', 'berjihad dijalan Allah swt dengan harta dan jiwanya', 'mempengaruhi orang lain untuk  memerangi orang kafir', 'E', '', '', '', '', '', '', ''),
	(41, 2, 12, 'orang yang beriman ,tidak akan luput dari ujian dan godaan yang terhadap keimanannya semakin beriman seseorang ,semakin besar pula ujian dari AllahSwt.baginya berikut ini yang bukan merupakan ujian bagi seorang mukmin adalah', 1, 'mukmin yang saling membenci satu sama lain', 'mukmin yang saling mendukung satu sama lain', 'datangnya orang munafik yang membenci kaum mukmin', 'godaan hawa nafsu dari dalam diri setiap mukmin itu sendiri', 'orang kafir yang memerangi kaum mukmin dengan tifu dayanya ', 'B', '', '', '', '', '', '', ''),
	(42, 2, 13, 'Bahrul adalah seorang muslim yang taat beribadah dan berprilaku baik di sekolah .sejak SMP dia bercita-cita untuk melanjutkan ke sekolah favorit di kotanya.bahkan dia pernah ber nadzar apabila ia di terima di sekolah tersebut.ia akan berpuasasunah selama tiga hari namun hingga saat ini bahrul belum juga menunaikan nadzar tersebut,karena tiap kali hendak berpuasa,selalu saja ada halangannya untuk menunda ,hal ini merupakan contoh ujian keimanan bagi bahrul yang datangnya dari', 1, 'bisikan setan', 'bisikan orang kafir', 'bisikan dari kaum munafik', 'bisikan orang mukmin lainnya', 'bisikan dari dalam hatinya sendiri', 'E', '', '', '', '', '', '', ''),
	(43, 2, 14, 'orang yang beriman secara kaffah ,akan senantiasa berhati-hati dalam kehidupannya.ia akan menepatkan Allah Swt ,sebagai tujuan utama dari setiap aktivitasnya.dengan demikian ,hikmah iman bagi seorang mukmin adalah', 1, 'membuat seseorang menjadi resah dan gelisah hidupnya', 'mudah terserang ujub,riya dansum\'ah dalam hidupnya', 'membuat seseorang hanya mengharap rida Allah Swt', 'membuat seseorang terhindar dari keberuntungan', 'membuat seseorang tergantung kepada makhluk ', 'C', '', '', '', '', '', '', ''),
	(44, 2, 15, 'Harta benda yang dimiliki oleh seseorang berpotensi menjerumuskannya dalam jeratan tipu daya setan ,padahal harta karunia Allah Swt.tersebut seharusnya di gunakan sebagai sarana ibadah.berikut ini merupakan contoh penggunaan harta yang benar ,kecuali', 1, 'disedekahkan untuk fakir miskin ', 'di gunakan biaya-biaya sekolah', 'disimpan untuk tabungan hari tua', 'membeli barang mewah dan unik untuk disimpan ', 'memenuhi kebutuhan keluarga', 'D', '', '', '', '', '', '', ''),
	(45, 2, 16, 'Allah Swt.sangat membenci sifat hidup berfoya-foya .oleh karena itu seorang muslim harus menghindari sufat tersebut.salah satu cara menghindari sifat hidup berfoya-foya adalah membiasakan bersedekah dan membantu orang lain.mengapa bisa demikian?', 1, 'sedekah akan mempercepat habisnya harta benda', 'amal kebaikan yang paling sulit dilakukan adalah sedekah', 'karena sedekah dapat menumbuhkan rasa empati kepada sesama', 'tidak ada satu pun manusia yang dapat lepas dari takdir AllahSwt ', 'sedekah akan menjadikan seseorang akan semakin terkenal', 'C', '', '', '', '', '', '', ''),
	(46, 2, 17, 'Perhatika pernyataan berikut ini!1.  Menerima dengan senang hati atas semua karunia dari Allah swt   2.   Merasa yakin bahwa Allah swt telah menjamin rejeki semua makhluk ciptaanya   3. kedua pernyataannya tersebut akan mewujudkan sifat-sifat berikut ini kecuali ', 1, 'qana\'ah', 'optimis', 'yakin', 'syukur', 'ta\'dzim', 'B', '', '', '', '', '', '', ''),
	(47, 2, 18, 'Kebanyakan manusia sering melupakan nikmat yang di terima dari Allah swt.mereka beranggapan bahwa harta dan kedudukan yang di peroleh merupakan hasil kerja kerasnnya .anggapan seperti inilah yang memicu munculnya sifat riya dan sum\'ah .Salah satu cara untuk menghindari perilaku riya adalah', 1, 'Memperhitungkan dampak ekonomi setiap amal kebaikan', 'melakukan amal kebaikan hanya karena Allah swt', 'Memilih hari yang tepat untuk melakukan ibadah', 'mengajak teman dekat untuk suatu amal ibadah', 'mencatatnya di buku catatan pribadi', 'B', '', '', '', '', '', '', ''),
	(48, 2, 19, 'Perhatikan pernyataan berikut!    Pada saat yang sudah di tentukan ,kematian akan menjemput setiap manusia itu artinya,kehidupan di dunia hanya sebentar dan sementara.Banyak orang menjadi takabur karena melupakan hal ini.mereka mengira bahwa kehidupan dunia kekal selamanya ,hingga lupa bekal hidup akhirat.                                                      Berdasarkan narasi tersebut ,bekal hidup di akhirat berupa', 1, 'Pangkat,kedudukan dan jabatan', 'Kekayaan harta yang melimpah', 'amal shaleh yang di lakukan dengan ikhlas', 'banyaknya keturunan', 'luasnya pergaulan dan teman dekat', 'B', '', '', '', '', '', '', ''),
	(49, 2, 20, 'Seseorang mengambil banyak makanan dan minuman pada suatu acara tasyakuran .ia takut tidak mendapat bagian ,tanpa sama sekali tidak mempertimbangkan daya tampung perut.akhirnya ia tidak sanggup menghabiskan makanan dan minuman tersebut itu termasuk kepada', 1, 'tabzir dan israf dalam makan dan minum', 'tabzir dan israf', 'tabzir dan israf dalam berbicara', 'tabzir dan israf dalam penampilan', 'tabzir dan israf dalam masakan', 'A', '', '', '', '', '', '', ''),
	(50, 2, 21, 'Harta merupakan cobaan bagi pemiliknya,jika harta digunakan dengan baik maka harta bisa bermanfaat baginya,sebaliknya kalau harta di kelola secara salah maka akan', 1, 'memuaskannya', 'mencelakakannya', 'membuat orang senang', 'membuat orang kufur', 'menyiksakannya', 'B', '', '', '', '', '', '', ''),
	(51, 2, 22, 'perhatikan pernyataan-pernyataan berikut ini !                 1. di benci oleh Allah swt.dan rosulnya                                 2.memperbanyak teman dan kenalan                                    3. mata hatinya terkunci dari memperoleh hidayah kebenaran                                                                 4. mendapatkan siksa dan kehinaan di akhirat                       5.mampu menaklukan dunia                                                        Manakah yang termasuk dampak negatif sifat takabur', 1, '1,2,3', '1,3,4', '1,3,5', '2,3,4', '3,4,5', 'B', '', '', '', '', '', '', ''),
	(52, 2, 23, 'apa yang terkandung dalam Qs Al-maidah/48 agar dapat berkompetensi dalam kebaikan lakukan \'M 6 apa artinya', 1, 'Mengawali              melakukan                         menjaga                    mempelajari                membiasakan                mengamati', 'Mendahului                    mengawali                         mengamati                  meraih                        merencanakan                membiasakan', 'Melakukan                   mengerjakan             menguasai               mengespor              meluap                     mempelajari', 'membangun                                merencanakan                              memelihara                                      memotipasi                                    membiasakan                              mengamati', 'semua jawaban benar', 'A', '', '', '', '', '', '', ''),
	(53, 2, 24, 'Manusia  terbaik adalah manusia yang mampu menebar manfaat dan kemaslahatan sebesar-besarnya kepada masyarakat ,nilai sebuah kebaikan akan berlipat ganda jika mampu', 1, 'memberikan keburukan bagi orang sekitarnya', 'memberikan motivasi dan dorongan kepada para pencari ilmu', 'memberikan manfaat yang besar untuk masyarakat luas', 'memberikan nilai yang lebih dari masyarakat luas', 'meberikan kebaikan bagi masyarakat luasnya', 'C', '', '', '', '', '', '', ''),
