	(986, 25, 37, 'Ini merupakan bagian akhir dari sebuah teks eksposisi yang berupa penguatan kembali atas pendapat yang telah ditunjang oleh fakta-fakta dalam bagian argumentasi. Disebut apa struktur teks eksposisi yang dimaksud ....', 1, 'Pernyataan pendapat (tesis)', 'Argumentasi', 'Contoh', 'Fakta', 'Penegasan ulang', 'E', '', '', '', '', '', '', ''),
