	(988, 25, 39, 'Semua orang dapat menyusun berita baik media elektronik maupun media cetak. Salah satu contoh teks eksposisi dapat dilihat di....', 1, 'telepon', 'koran', 'diskusi', 'seminar', 'sidang', 'B', '', '', '', '', '', '', ''),
	(989, 25, 40, ' Dalam suatu teks eksposisi bagian pembuka yagn memuat tentang pandangan awal penulis. Pandangan awal penulis tersebut bersifat opsional. Sifat dari opsional mengandung arti....', 1, 'wajib ada dalam suatu teks eksposisi', 'setengah ada dalam suatu teks ekspoisi', 'boleh ada dan boleh juga tidak ada dalam suatu teks eksposisi', 'topik dalam teks boleh seperti rangkuman', 'judul dalam pembuka dapat dimasukkan', 'C', '', '', '', '', '', '', ''),
	(990, 25, 1, '<p>Apa yang dimaksud dengan Teks Laporan Hasil Observasi?</p>', 1, '<p>Teks yang berisi langkah-langkah atau tahapan yang harus dilakukan untuk mencapai suatu tujuan.</p>', '<p>Teks yang menjelaskan sebab akibat suatu fenomena, baik itu peristiwa alam, ilmu pengetahuan, sosial, budaya, dan lainnya.</p>', '<p>Teks yang memberikan informasi secara umum tentang sesuatu berdasarkan fakta dari hasil pengamatan secara langsung di lapangan.</p>', '<p>Teks atau karangan yang terkandung sejumlah informasi dan pengetahuan yang disajikan secara singkat, padat, dan akurat.</p>', '<p>Teks yang menjelaskan dan menceritakan tentang fakta dan kejadian masa lalu yang menjadi latar belakang terjadinya sesuatu yang mempunyai nilai sejarah.</p>', 'C', '', '', '', '', '', '', ''),
	(991, 25, 5, '<p>Pahamilah kutipan teks berikut ini! Bekam atau hijamah ialah sebuah teknik pengobatan yang dilakukan dengan jalan membuang darah kotor (racun yang berbahaya) dari dalam tubuh lewat permukaan kulit. Menurut pemahaman umum, sebenarnya bekam berfungsi untuk membang darah yang teah rusak atau teroksidasi karena tingginya oksidan dalam tubuh.&nbsp;Kutipan teks di atas termasuk salah satu struktur teks laporan hasil observasi, yaitu?</p>', 1, '<p>Pernayataan umum</p>', '<p>Anggota/aspek yang dilaporkan</p>', '<p>Kalimat opini</p>', '<p>Kalimat definisi</p>', '<p>Kalimat fakta</p>', 'A', '', '', '', '', '', '', ''),
	(992, 25, 7, '<p>Pahamilah paragraf di bawah ini! Harimau dapat mencapai tinggi 1, 5 meter, panjang 3, 3 meter, dan berat 300 kiligram. Bulunya berwarna putih dan coklat keemasan dengan belang atau loreng berwarna hitam. Gigi taringnya kuat dan tajam untuk mengoyak daging. Kakinya berjumlah empat dengan cakar yang kuat untuk menerkam mangsanya. Teks laporan hasil observasi di atas berjenis apa?</p>', 1, '<p>definisi</p>', '<p>eksposisi</p>', '<p>klasifikasi</p>', '<p>deskripsi</p>', '<p>argumentasi</p>', 'D', '', '', '', '', '', '', ''),
	(993, 25, 8, '<p>Pahamilah kalimat di bawah ini! Pelikan adalah burung yang terkenal dengan paruhnya yang memiliki kantung. Jenis kalimat apa pada contoh kalimat di atas?</p>', 1, '<p>kalimat klasifikasi</p>', '<p>kalimat deskripsi</p>', '<p>kalimat definisi</p>', '<p>kalimat imperatif</p>', '<p>kalimat perbandingan</p>', 'C', '', '', '', '', '', '', ''),
	(994, 25, 9, '<p>Pahamilah kalimat di bawah ini! Paruhnya yang meruncing panjangnya bisa lebih dari 30 cm dan bagian sebelah atas memiliki ujung yang bengkok membentuk kait. Jenis kalimat apa pada contoh kalimat di atas?</p>', 1, '<p>kalimat klasifikasi</p>', '<p>kalimat deskripsi</p>', '<p>kalimat definisi</p>', '<p>kalimat imperatif</p>', '<p>kalimat perbandingan</p>', 'B', '', '', '', '', '', '', ''),
	(995, 25, 13, '<p>Pahamilah wacana berikut dengan saksama!&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>Bendungan di Desa air. Karena terbuat dari karet, tinggi permukaannya bisa diatur secara fleksibel. Bila terjadi banjir, bantalan karet itu dikempiskan. Dan air bah lancar mengalir ke laut. Sebaliknya, bila volume air sungai mengecil, tubuh bendungan diisi penuh, sehingga tingginya mencapai 3 m. Sungai terbendung dan airnya dimanfaatkan sebagai air minum dan irigasi. Pada saat yang sama, air pasang dari laut akan terhambat dan tak mencemari sungai yang menjadi sumber utama air tawar masyarakat Jatirogo ini tidak ada duanya di Indonesia. Tubuh bendungan tersebut dari bantalan karet berisi di sekitar sungai. Manakan kalimat kompleks hipotaktik dari teks di atas?</p>', 1, '<p>Bendungan di Desa Jatirogo ini tidak ada duanya di Indonesia.</p>', '<p>Sungai terbendung dan airnya dimanfaatkan sebagai air minum dan irigasi.</p>', '<p>Tubuh bendungan tersebut dari bantalan karet berisi air.</p>', '<p>Karena terbuat dari karet, tinggi permukaannya bisa diatur secara fleksibel.</p>', '<p>Objek wisata alam di Bantul membuat pengunjungnya berdecak kagum.</p>', 'D', '', '', '', '', '', '', ''),
	(996, 25, 14, '<p>Pahamilah dengan seksama penggalan teks berikut ini!</p>\n<p>Objek wisata alam di Bantul membuat pengunjungnya berdecak kagum. Demikian pula dengan wisata alam buatan dan tempat-tempat bersejarah di kabupaten Bantul memiliki daya tarik bagi wisatawan. Pemandangan alam dan perbukitan yang menawan dengan bentangan pantai selatan yang berselimut mitos kecantikan Gusti Kanjeng Ratu Kidul adalah pesona tersendiri yang membuat wisatawan selalu berduyun-duyun datang ke wilayah selatan Bantul. Wisata alam Pantai Selatan masih menjadi tujuan kunjungan wisatawan di daerah itu karena memiliki pesona yang indah.&nbsp;</p>\n<p>Manakan kalimat simpleks dari teks di atas?</p>', 1, '<p>Demikian pula dengan wisata alam buatan dan tempat-tempat bersejarah di kabupaten Bantul memiliki daya tarik bagi wisatawan.</p>', '<p>Pemandangan alam dan perbukitan yang menawan dengan bentangan pantai selatan yang berselimut mitos kecantikan Gusti Kanjeng Ratu Kidul adalah pesona tersendiri yang membuat wisatawan selalu berduyun-duyun datang ke wilayah selatan Bantul.</p>', '<p>Objek wisata alam di Bantul membuat pengunjungnya berdecak kagum.</p>', '<p>Wisata alam Pantai Selatan masih menjadi tujuan kunjungan wisatawan di daerah itu karena memiliki pesona yang indah</p>', '<p>Pada saat yang sama, air pasang dari laut akan terhambat dan tak mencemari sungai yang menjadi sumber utama air tawar masyarakat Jatirogo ini tidak ada duanya di Indonesia.</p>', 'C', '', '', '', '', '', '', ''),
	(997, 25, 29, '<p>Kalimat yang menggunakan satu verba utama disebut...</p>', 1, '<p>kalimat kompleks</p>', '<p>kalimat simpleks</p>', '<p>kalimat deskripsi</p>', '<p>kalimat definisi</p>', '<p>kalimat penjelas</p>', 'B', '', '', '', '', '', '', ''),
	(998, 26, 2, 'Cermatilah kalimat-kalimat berikut.<br>\n(1) Setelah itu, diletakkan dalam sebuah wadah, diberi ragi dan terkadang diberi sedikit gula untuk mempermanis rasanya.<br>\n(2) Selain dari beras ketan, tape tebuat dari singkong yang telah dikupas kemudian direbus.<br>\n(3) Hal ini bertujuan agar terjadi fermentasi.<br>\n(4) Pemberian ragi hendaknya rata.<br>\n(5) Langkah terakhir menutup tape yang beragi dan diberi gula tadi dengan daun pisang serta penutup berupa kain hingga rapat.<br>\n(6) Setelah lebih dari 3 hari, singkong telah berubah menjadi tape yang enak rasanya dan siap disantap<br>\n(7) Selanjutnya tape diitutup selama lebih dari 3 hari dan tidak boleh dalam selang waktu tersebut, penutupnya dibuka.<br>\n<br><br>\nUrutan yang tepat langkah-langkah prosedur di atas adalah?\n', 1, '2 â€“ 1 â€“ 3 â€“ 4 â€“ 6 â€“ 5 â€“ 7', '2 â€“ 1 - 3 â€“ 6 â€“ 7 - 5 â€“ 4', '2 â€“ 1 â€“ 4 â€“ 3 â€“ 5 â€“ 7 â€“ 6', '2 â€“ 1 â€“ 4 â€“ 5 â€“ 3 â€“ 7 â€“ 6', '2 â€“ 3 â€“ 1 â€“ 4 â€“ 5 â€“ 6 â€“ 7 ', 'C', '', '', '', '', '', '', ''),
	(999, 26, 3, 'Perhatikan wacana berikut dengan cermat! <br>\nDi Indonesia banyak pengendara kendaraan bermotor. Jika pengendara melakukan pelanggaran, tentu pihak berwajib akan menilangnya. Pengendara kendaraan bermotor perlu mengetahui prosedur penilangan. Berikut ini hal yang harus Anda perhatikan ketika dikenakan surat bukti pelanggaran, Anda tidak akan dirugikan dan akan mendapat sanksi sesuai dengan peraturan. <br><br>\n\nKalimat yang menyatakan tujuan terdapat dalam kalimat berikut?\n', 1, 'Di Indonesia banyak pengendara kendaraan bermotor.', 'Jika pengendara melakukan pelanggaran, tentu pihak berwajib akan menilangnya.', 'Pengendara kendaraan bermotor perlu mengetahui prosedur penilangan.', 'Berikut ini hal yang harus Anda perhatikan ketika dikenakan surat bukti pelanggaran.', 'Anda tidak akan dirugikan dan akan mendapat sanksi sesuai dengan peraturan.', 'E', '', '', '', '', '', '', ''),
	(1000, 26, 4, 'Simaklah wacana berikut dengan saksama! <br>\n1) Yakinlah bahwa kalian telah mengenakan pakaian dengan rapi atau mengenakan pakaian sesuai dengan isi puisi yang akan kalian baca.<br>\n2) Berdirilah dengan tegak dan tenang di atas pentas sebelum kalian memulai membaca.<br>\n3) Kuasailah pentas dan penonton dengan mengarahkan pandangan ke segala penjuru sambil memberikan penghomatan kepada mereka dengan cara menganggukkan kepala.<br><br>\n\nKutipan teks tersebut dalam teks prosedur termasuk sebagai struktur apa?\n', 1, 'latar belakang', 'tujuan', 'langkah-langkah', 'kesimpulan', 'saran-saran', 'C', '', '', '', '', '', '', ''),
	(1001, 26, 5, 'Pamahilah penggalan teks berikut dengan saksama! <br>\n1) Yakinlah bahwa kalian telah mengenakan pakaian dengan rapi atau mengenakan pakaian sesuai dengan isi puisi yang akan kalian baca.<br>\n2) Berdirilah dengan tegak dan tenang di atas pentas sebelum kalian memulai membaca.<br>\n3) Kuasailah pentas dan penonton dengan mengarahkan pandangan ke segala penjuru sambil memberikan penghomatan kepada mereka dengan cara menganggukkan kepala.<br>\n<br><br>\nTujuan dalam teks prosedur tersebut adalah?\n', 1, 'Untuk memahami cara membaca puisi di atas pentas.', 'Untuk mengetahui cara membaca puisi dengan baik.', 'Untuk mengembangkan secara kreatif sebuah puisi.', 'Untuk meningkatkan potensi membaca puisi di pentas.', 'Untuk mengetahui teknik membaca puisi di atas pentas.', 'D', '', '', '', '', '', '', ''),
	(1002, 26, 6, 'Pahamilah kalimat di bawah ini!<br>\nParuhnya yang meruncing panjangnya bisa lebih dari 30 cm dan bagian sebelah atas memiliki ujung yang bengkok membentuk kait. \n<br><br>\nJenis kalimat apa pada contoh kalimat di atas? ', 1, 'kalimat klasifikasi', 'kalimat deskripsi', 'kalimat definisi', 'kalimat imperatif', 'kalimat perbandingan', 'B', '', '', '', '', '', '', ''),
	(1003, 26, 7, 'Pamahilah penggalan teks berikut dengan saksama! <br><br>\nCara Membuat Lilin Aroma Terapi<br>\nLilin aroma terapi sangat banyak diminati, khususnya bagi anda yang ingin mengharumkan kamar dengan wangi bahan atau bunga alami yang menenangkan. sekain banyak dijual, lilin aroma terapi juga bisa jadi lahan bisnis lho, berikut ini cara membuat lilin aroma terapi yang bisa dipraktikkan di rumah. \n<br><br>\nPenggalan teks diatas merupakan salah satu struktur teks prosedur, yaitu bagian?\n', 1, 'material ', 'langkah-langkah', 'deklaratif', 'pernyataan umum atau tujuan ', 'imperatif', 'D', '', '', '', '', '', '', ''),
	(1004, 26, 8, 'Pamahilah penggalan teks berikut dengan saksama! <br><br>\nCara Pembuatan Lilin<br>\n1) Panaskan lilin diatas wajan dengan api kecil dan sisihkan sumbunya<br>\n2) Tambahkan parfum pada saat lilin dipanaskan dengan hati-hati<br>\n3) Setelah lilin leleh, masukkan ke dalam gelas bekas dan pasang sumbunya<br>\n4) Tunggu beberapa saat hingga mengering, pecahkan gelas perlahan<br>\n5) Setelah lilin tercetak, panaskan bagian tepi lilin untuk ditempeli dengan kayu manis, susun kayu manis sampai habis<br>\n6) Tunggu kering dan lilin siap digunakan<br><br>\n\nKata-kata bercetak tebal di atas termasuk dalam kaidah kebahasaan teks prosedur, yaitu?\n', 1, 'verba material', 'konjungsi temporal', 'Konjungsi bersyarat', 'Kalimat imperatif', 'Kalimat deklaratif', 'B', '', '', '', '', '', '', ''),
	(1005, 26, 9, 'Bacalah kutipan teks eksplanasi berikut ini. <br>\n(1) Virus Corona atau COVID-19 (Corona Virus Disease 2019) merupakan pandemi yang pertama kali ditemukan di daerah kota Wuhan, Cina pada akhir Desember 2019 lalu. (2) Virus ini menyebar dengan sangat cepat dan menyebar ke berbagai wilayah.  (3) Virus Corona adalah bentuk kumpulan virus yang mampu menginfeksi sistem pernafasan manusia. (4) Kemudian virus ini akan terus menginfeksi imun tubuh yang lemah dan dapat berujung pada kematian. (5) Karena penyebarannya yang sangat cepat dan luas, virus Corona telah ditetapkan sebagai pandemi global hingga saat ini. (6) Dan menyebabkan banyak kerugian bagi semua pihak.  \n<br><br>\nManakah yang termasuk jenis kalmat majemuk bertingkat/ komplek hipotaktik?\n  ', 1, '-1', '-2', '-3', '-4', '-5', 'D', '', '', '', '', '', '', ''),
	(1006, 26, 10, 'Pamahilah penggalan teks berikut dengan saksama!<br>\nCara Membuat Minyak Kemiri<br>\nMinyak kemiri bisa kita dapatkan di toko kecantikan atau apotek terdekat. Namun, bila ingin lebih hemat, anda dapat membuatnya sendiri dirumah. Berikut cara membuat minyak kemiri tradisional. Silahkan dicoba.\n<br>\nBahan dan cara pembuatan	<br>\n1) Sediakan 5 hingga 10 butir kemiri utuh, cuci bersih dan keringkan.<br>\n2) Anda dapat membakar kemiri hingga hitam diatas bara api kecil atau masukkan kemiri dalam wajan yang sudah dipanaskan tanpa minyak alias disangrai.<br>\n3) Sangrailah kemiri hingga berwarna hitam kecoklatan, angkat.<br>\n4) Sediakan kain kasa atau kain serbet makan dan bungkus kemiri.<br>\n5) Tumbuklah kemiri dari luar hingga hancur sambil ditekan. Pada proses tersebut minyak kemiri dapat sesekali diperas dan ditaruh pada sendok (pemerasan dilakukan dengan kain kasa).<br>\n6) Minyak kemiri siap dipakai.<br>\n7) Nah, itu tadi cara mendapatkan minyak kemiri dengan usaha sendiri tanpa harus membeli, lebih hemat dan lebih alami.<br>\n<br><br>\nBagian bercetak tebal di atas termasuk dalam kaidah kebahasaan teks prosedur, yaitu?\n', 1, 'konjungsi temporal', 'konjungsi bersyarat', 'kalimat deklaratif', 'kalimat imperatif', 'kalimat interogatif', 'D', '', '', '', '', '', '', ''),
	(1007, 26, 11, 'Perhatikan kutipan teks berikut! \nSampah merupakan salah satu fenomena yang sering kali kita temui di lingkungan masyarakat. Sampah mulanya terlihat biasa berserakan di sekitar kita, namun sampah tersebut memeberikan dampak yang besar. Seperti sarang penyakit, banjir, dan tanah longsor. Sampah yang dibiarkan menumpuk akan mendatangkan bau yang tidak sedap sehingga akan mencemari udara yang nantinya akan mendatangkan penyakit seperti muntaber, dan DBD. Selain itu sampah juga dapat mendatangkan bencana seperti banjir dan tanah longsor. Sampah yang dibuang ke sungai secara terus-menerus, akan membuat air sungai menjadi sulit mengalir, dan lama-kelamaan air sungai meluap. Apabila banjir, tentu saja akan menyulitkan kita untuk beraktivitas dan bekerja. Selain itu, banjir yang sangat besar dapat menyebabkan tanah longsor.\n\nKutipan teks tersebut merupakan salah satu struktur teks eksplanasi yaitu?', 1, 'deretan penjelas', 'pernyataan umum ', 'interpretasi ', 'fakta ', 'pendapat', 'A', '', '', '', '', '', '', ''),
	(1008, 26, 12, 'Perhatikan kutipan teks berikut! \nSampah merupakan barang atau benda yang sudah tidak digunakan lagi, yang keberadaannya sangat mengganggu kesehatan masyarakat disekitar. Sampah dibagi menjadi dua jenis, yaitu sampah organik dan sampah anorganik. Sampah organik adalah jenis sampah yang mudah terurai seperti sayuran, daun-daun kering, dan sisa-sisa makanan. Sampah ini dapat diolah sebagai pupuk atau kompos untuk tanaman.\n<br><br>\nKutipan teks di atas termasuk dalam struktur teks eksplanasi bagian?\n ', 1, 'pernyataan umum ', 'urutan sebab-akibat ', 'interpretasi/ pendapat penulis', 'fakta ', 'pendapat', 'A', '', '', '', '', '', '', ''),
	(1009, 26, 13, 'Perhatikan kutipan teks berikut! <br>\nRata-rata setiap petir mempunyai sampai 5 jalur utama akibat adanya ionisasi. Persiapan pelepasan elektron melalui jalur ini membutuhkan waktu sekitar 0,01 sekon. Setelah itu akan terjadi petir dengan waktu sekitar 0,0004 sekon. Sebelum terjadi petir selanjutnya, dibutuhkan waktu istirahat selama 0,03-0,05 sekon. Rata-rata kuat arus dalam petir sebesar 20.000 ampere. \n<br><br>\nKata yang bercetak tebal termasuk dalam salah satu kaidah kebahasaan teks eksplanasi yaitu bagian?\n', 1, 'Menggunakan verba material dan verba relasional.', 'Menggunakan konjungsi temporal.', 'Bahasa yang ringkas, menarik dan jelas.', 'Istilah ilmiah.', 'Hal umum.', 'B', '', '', '', '', '', '', ''),
	(1010, 26, 14, 'Cermati kutipan berikut! <br>\nFaktor utama untuk bersaing adalah SDM yang sekaligus sebagai subjek dalam berproduksi. SDM perusahaan atau industri harus memiliki kemampuan teknis profesional dan adaptif. Kemampuan teknis profesional adalah keahlian menghasilkan barang dan jasa dengan sarana teknologi yang memadai. Kemampuan adaptif adalah kesanggupan SDM untuk menyesuaikan diri dengan lingkungan alam, sosial, dan lingkungan kerja, disiplin dan niai-nilai dalam perusahaan itu sendiri. Dengan kata lain, mereka harus memiliki kemampuan normatif.\n<br><br>\nTentukan dan temukanlah kalimat yang menggunakan konjungsi koordinatif pada teks tersebut!', 1, 'Faktor utama untuk bersaing adalah SDM yang sekaligus sebagai subjek dalam berproduksi.', 'SDM perusahaan atau industri harus memiliki kemampuan teknis profesional dan adaptif.', 'Kemampuan adaptif adalah kesanggupan SDM untuk menyesuaikan diri dengan lingkungan.', 'dengan lingkungan alam, sosial, dan lingkungan kerja', 'Dengan kata lain, mereka harus memiliki kemampuan normatif.', 'B', '', '', '', '', '', '', ''),
	(1011, 26, 15, 'Perhatikan kutipan teks berikut! <br>\nSampah merupakan salah satu fenomena yang sering kali kita temui di lingkungan masyarakat. Sampah mulanya terlihat biasa berserakan di sekitar kita, namun sampah tersebut memeberikan dampak yang besar. Seperti sarang penyakit, banjir, dan tanah longsor. Sampah yang dibiarkan menumpuk akan mendatangkan bau yang tidak sedap sehingga akan mencemari udara yang nantinya akan mendatangkan penyakit seperti muntaber, dan DBD. Selain itu sampah juga dapat mendatangkan bencana seperti banjir dan tanah longsor. Sampah yang dibuang ke sungai secara terus-menerus, akan membuat air sungai menjadi sulit mengalir, dan lama-kelamaan air sungai meluap. Apabila banjir, tentu saja akan menyulitkan kita untuk beraktivitas dan bekerja. Selain itu, banjir yang sangat besar dapat menyebabkan tanah longsor.\n<br><br>\nTentukan dan temukanlah kalimat yang menggunakan konjungsi subordinatif pada teks tersebut!', 1, 'Sampah merupakan salah satu fenomena yang sering kali kita temui di lingkungan masyarakat.', 'Sampah yang dibuang ke sungai secara terus-menerus, akan membuat air sungai menjadi sulit mengalir, dan lama-kelamaan air sungai meluap.', 'Sampah mulanya terlihat biasa berserakan di sekitar kita.', 'Sampah yang dibiarkan menumpuk akan mendatangkan bau yang tidak sedap sehingga akan mencemari udara yang nantinya akan mendatangkan penyakit seperti muntaber, dan DBD.', 'Banjir yang sangat besar dapat menyebabkan tanah longsor.', 'D', '', '', '', '', '', '', ''),
	(1012, 26, 16, 'Perhatikan kutipan teks berikut!<br>\nGempa tektonik terjadi karena lapisan kerak bumi menjadi lunak sehingga mengalami pergeseran atau pergerakan. \n<br><br>\nKalimat tersebut terdapat konjungsi apa?', 1, 'konjungsi temporal dan subordinatif', 'konjungsi subordinatif dan koordinatif', 'konjungsi korelatif dan temporal', 'konjungsi koordinatif dan korelatif', 'konjungsi subordinatif dan korelatif', 'B', '', '', '', '', '', '', ''),
	(1013, 26, 17, 'Perhatikan kutipan teks berikut! <br>\nKemiskinan adalah tingkat masyarakat dengan pendapatan yang rendah. Dengan pendapatan yang rendah, masyarakat tidak mampu untuk mencukupi kebutuhan pokok, seperti makan, minum, pakaian, tempat berlindung, dan pendidikan.\n<br><br>\nKutipan teks tersebut mengandung salah satu struktur teks eksplanasi yaitu bagian?', 1, 'pendapat ', 'fakta ', 'urutan sebab-akibat ', 'pernyataan umum ', 'interpretasi', 'D', '', '', '', '', '', '', ''),
	(1014, 26, 18, 'Perhatikan kutipan teks berikut!<br>\nGempa bumi terjadi karena pergesaran atau gerakan lapisan dasar bumi dan letusan gunung berapi yang sangat dahsyat. Selain itu, gempa bumi terjadi begitu cepat dengan dampak yang sangat besar bagi lingkungan sekitarnya. Getaran gempa bumi yang sangat besar dan merambat ke segala arah sehingga dapat meratakan bangunan dan menimbulkan korban jiwa. Berdasarkan penyebab terjadinya, gempa bumi dapat digolongkkan menjadi dua jenis, yaitu gempa vulkanik dan gempa tektonik. Gempa tektonik terjadi karena lapisan kerak bumi menjadi lunak sehinggal mengalami pergeseran atau pergerakan. Teori â€œTektonik Plateâ€ menjelaskan bahwa bumi kita ini terdiri dari beberapa lapisan buatan. Sebagian besar daerah lapisan kerak ini akan hanyut dan mengapung dilapisan, seperti halnya salju. Lapisan ini bergerak sangat lambat sehingga terpecah-pecah dan bertabrakan satu sama lain. Itulah yang menyebabkan mengapa gempa bumi dapat terjadi. Sementara itu, gempa bumi vulkanik terjadi dikarenakan adanya letusan gunung berapi yang sangat besar. Gempa vulkanik ini lebih jarang terjadi dibandingkan dengan gempa tektonik.\n<br><br>\nKutipan teks tersebut termasuk salah satu struktur teks eksplanasi yaitu bagian? ', 1, 'pernyataan umum ', 'interpretasi ', 'fakta', 'pendapat ', 'deratan penjelas', 'E', '', '', '', '', '', '', ''),
	(1015, 26, 19, 'Bacalah kutipan teks eksplanasi berikut ini.<br>\n(1) Banjir adalah fenomena alam yang bersumber dari curah hujan dengan intensitas tinggi dan durasi lama pada daerah aliran sungai (DAS). (2) Banjir terjadi karena alam dan tindakan manusia. (3) Penyebab alami banjir adalah erosi dan sedimentasi, curah hujan, pengaruh fisiografi/geofisik sungai, kapasitas sungai, drainase lahan, dan pengaruh air pasang. (4) Penyebab banjir karena tindakan manusia adalah perubahan tata guna lahan, pembuangan sampah, kawasan padat penduduk di sepanjang sungai, dan kerusakan bangunan pengendali banjir. (5) Baik banjir yang disebabkan oleh alam maupun oleh manusia, perlu diwaspadai dan diatasi. \n<br><br>\nManakah yang termasuk jenis kalmat majemuk setara/ komplek parataktik?', 1, '-1', '-2', '-3', '-4', '-5', 'D', '', '', '', '', '', '', ''),
	(1016, 26, 20, 'Bacalah kutipan teks eksplanasi berikut ini.<br>\n(1) Banjir adalah fenomena alam yang bersumber dari curah hujan dengan intensitas tinggi dan durasi lama pada daerah aliran sungai (DAS). (2) Banjir terjadi karena alam dan tindakan manusia. (3) Penyebab alami banjir adalah erosi dan sedimentasi, curah hujan, pengaruh fisiografi/geofisik sungai, kapasitas sungai, drainase lahan, dan pengaruh air pasang. (4) Penyebab banjir karena tindakan manusia adalah perubahan tata guna lahan, pembuangan sampah, kawasan padat penduduk di sepanjang sungai, dan kerusakan bangunan pengendali banjir. (5) Baik banjir yang disebabkan oleh alam maupun oleh manusia, perlu diwaspadai dan diatasi. \n<br><br>\nJenis kalimat yang digunakan dalam kalimat nomor 1 pada paragraf berikut adalah?', 1, 'kalimat definisi ', 'kalimat interogatif ', 'kalimat imperatif ', 'kalimat kompleks', 'kalimat deskriptif', 'A', '', '', '', '', '', '', ''),
	(1017, 26, 21, 'Berikut ini ciri-ciri teks eksplanasi, kecuali?', 1, 'struktur terdiri atas pernyataan umum, deretan penjelas, dan penutup', 'memuat informasi sesungguhnya/fakta', 'memuat informasi yang bersifat keilmuan', 'menjelaskan suatu kondisi atau fenomena', 'berisi langkah-langkah kerja', 'E', '', '', '', '', '', '', ''),
	(1018, 26, 22, 'Bagaimanakah perbedaan antara prosedur kompleks dengan teks prosedur sederhana?', 1, 'Langkah teks prosedur lebih rumit.', 'Langkah-langkahnya tidak memenuhi hal-hal yang rumit.', 'Apabila salah satu syarat tidak dipenuhi, langkah selanjutnya tidak jalan.', 'Langkah-langkah yang satu menentukan langkah yang lain.', 'Langkah-langkah hanya dapat dilakukan dengan memenuhi syarat sebelumnya.', 'A', '', '', '', '', '', '', ''),
