	(1021, 26, 25, 'Berikut ini bukan merupakan ciri-ciri kebahasaan yang terdapat dalam teks prosedur kompleks ...', 1, 'Menggunakan partisipan manusia.', 'Menggunakan verba material dan tingkah laku.', 'Menggunakan kalimat imperatif.', 'Menggunakan konjungsi syarat.', 'Menggunakan kalimat alternatif.', 'E', '', '', '', '', '', '', ''),
	(1022, 26, 26, 'Berikut yang bukan merupakan ciri kebahasaan teks prosedur kompleks adalah â€¦.', 1, 'memiliki struktur â€œtujuan langkah-langkah', 'menggunakan verbal material', 'lucu dan menarik', 'menggunakan kalimat imperatif', 'menggunakan kalimat partisipan manusia', 'C', '', '', '', '', '', '', ''),
	(1023, 26, 27, 'Bioteknologi adalah istilah yang berasal dari bahasa latin yang terdiri atas kata bio yang berarti â€œhidupâ€ dan teknos yang berarti â€œteknologiâ€ serta logos yang berarti â€œilmu.â€ Selanjutnya bioteknologi diartikan sebagai kajian ilmu terapan yang konsen terhadap rangkaian proses biologis dalam rangka menghasilkan barang dan jasa yang menerapkan prinsip sains. Perkembangan bioteknologi tak hanya didasarkan pada cabang keimuan biologi saja, namun juga pada disiplin ilmu terapan lainnya semisal biologi molekuler, komputer, biokimia, genetika, kimia, mikrobiologis, matematika, dan lain sebagainya     Teks tentang bioteknologi di atas menggunakan pola pengembangan â€¦', 1, 'Contoh', 'Definisi', 'Klasifikasi', 'Kronologis', 'proses', 'B', '', '', '', '', '', '', ''),
	(1024, 26, 28, 'Cara-cara yang ditempuh agar tujuan tercapai merupakan bagian dari struktur prosedur yang disebut ...', 1, 'Langkah-langkah', 'Tujuan', 'Reaksi', 'Orientasi', 'Koda', 'A', '', '', '', '', '', '', ''),
	(1025, 26, 29, 'Ceramah bersifat menyeluruh tidak ada batasan apapun baik dari audiens  yang muda maupun yang tua, hal tersebut disebut ceramah …', 1, 'khusus', 'illegal', 'luar', 'dalam', 'umum', 'E', '', '', '', '', '', '', ''),
