	(1027, 26, 31, 'Cermati teks berikut ! <br>Batang pisang dikerap cukup dalam, kemudian batang pisang dirobohkan pelan-pelan. <br>Caranya, salah satu pelepah daunnya ditarik sampai hampir roboh. Tandanya pisang jangan sampai membentur tanah agar tidak trusak. Sebelum tandan dekat ke tanah, ujung tandan dipegang dengan tangan atau disangga dengan alat yang telah disediakan.<br><br> Kutipan tersebut merupakan bagian dari.....', 1, 'Cara memanen buah pisang', 'cara memanfaatkan buah pisang', 'tanda-tanda buah pisang siap panen', 'buah pisang sebagai bahan keripik pisang', 'manfaat buah pisang selain sebagai buah meja', 'A', '', '', '', '', '', '', ''),
	(1028, 26, 32, 'Dalam teks prosedur kompleks, hasil akhir yang akan dicapai terdapat dalam bagian …', 1, 'langkah langkah', 'tujuan', 'abstrak', 'orientasi', 'koda', 'B', '', '', '', '', '', '', ''),
