	(1030, 26, 34, 'Kalimat yang berfungsi untuk memberikan informasi atau berita tentang sesuatu disebut kalimat ...', 1, 'Jamak ', 'Tunggal', 'Imperatif', 'Interogatif', 'Deklaratif', 'E', '', '', '', '', '', '', ''),
