	(1032, 26, 36, 'Kata membagi dan menggolongkan mengandung makna yang sama, sedangkan kata seluruhnya berlawanan makna dengan sebagian. Kata-kata yang berbeda, tetapi mempunyai makna yang sama disebut â€¦', 1, 'sinonim', 'Homonim', 'Homofon', 'Homograf', 'Polisemi', 'A', '', '', '', '', '', '', ''),
