	(1034, 26, 38, 'Mengapa teks prosedur kompleks dikatakan ?', 1, 'Karena teks prosedur kompleks disusun secara sistematis.', 'Karena langkah-langkah yang ada hanya dapat dilakukan dengan memenuhi berbagai syarat.', 'Karena digunakannya konjungsi temporal.', 'Karena langkah-langkah awal untuk mencapai tujuan berkesan kompleks.', 'Karena langkah awal merupakan syarat bagi langkah berikutnya', 'B', '', '', '', '', '', '', ''),
