	(1037, 26, 1, '<p>Cermatilah teks berikut. Untuk mematikan komputer, Anda dapat mengeklik tombol&nbsp;start. Kemudian pilih&nbsp;shutdown.&nbsp;Dengan menekan&nbsp;shutdown, komputer akan mati secara otomatis. Setelah program komputer hilang, tekanlah tombol&nbsp;power&nbsp;pada layar monitor dan stabilizer saluran listrik. Cabutlah steker listrik ke komputer untuk mengakhiri proses operasi computer. Teks di atas merupakan teks?</p>', 1, '<p>laporan</p>', '<p>eksposisi</p>', '<p>negosiasi</p>', '<p>prosedur</p>', '<p>anekdot</p>', 'D', '', '', '', '', '', '', ''),
	(1038, 27, 1, 'Berikut cara membuat surat lamaran kerja yang baik dan benar, kecualiâ€¦.', 1, 'Menggunakan tata bahasa yang baik dan benar', 'Format penulisan tersusun rapid an tidak bertele-tele', 'Menggunakan bahasa yang tidak baku dan nonformal', 'Dilengkapi dengan data-data yang dibutuhkan oleh perusahaan', 'Lampirkan surat pendukung lainnya, seperti sertifikat dll.', 'C', '', '', '', '', '', '', ''),
	(1039, 27, 2, 'Cermati kalimat pembuka surat lamaran pekerjaan berikut! <br>\nBerdasarkan iklan di Harian Kisah, 9 Oktober 2017, saya sangat ingin menjadi teknisi komputer pada perusahaan yang Bapak/Ibu pimpin.<br><br>\nPerbaikan kalimat pembuka surat lamaran pekerjaan tersebut adalah ... \n', 1, 'Mengganti â€œsangat inginâ€ menjadi â€œmenginginkanâ€ ', 'Mengganti â€œsangat inginâ€ menjadi â€œdengan ini melamarnya', 'Mengganti â€œsangat inginâ€ menjadi â€œmengajukan lamaran pekerjaanâ€', 'Mengganti â€œsangat inginâ€ menjadi â€œbermaksud inginâ€ ', 'Mengganti â€œsangat inginâ€ menjadi â€œdengan ini menginginkanâ€', 'C', '', '', '', '', '', '', ''),
	(1040, 27, 3, 'Cermati kalimat berikut!<br>\nSebagai bahan pertimbangan, bersama ini saya lampirkan... <br>\nPernyataan tersebut ditulis dalam surat lamaran pekerjaan pada bagian ... \n', 1, 'Identitas', 'Pembuka', 'Penutup', 'Isi', 'Lampiran', 'D', '', '', '', '', '', '', ''),
	(1041, 27, 4, 'Bagian isi surat balasan lamaran pekerjaan yang berisi penolakan secara jelas dan benar adalah …', 1, 'Menyesal sekali lamaran Anda belum dapat kami terima ', 'engan penuh rasa penyesalan saya tidak dapat menerima surat lamaran Anda \n', 'Menyesal sekali lamaran Anda belum dapat kami terima \nDengan penuh penyesalan lamaran Anda tidak bisa kami terima', 'Menyesal sekali lamaran Anda belum dapat kami terima \nSurat lamaran Anda telah kami terima, namun dengan sangat menyesal kami belum dapat menerima Anda\n', 'Kantor kami belum membutuhkan pelamar baru sehingga Anda belum bisa dipertimbangkan\n', 'D', '', '', '', '', '', '', ''),
	(1042, 27, 5, 'Unsur surat yang termasuk dalam bagian isi adalah …', 1, 'Salam pembuka, paragraf pembuka, dan paragraf isi ', 'Paragraf pembuka, paragraf isi, dan paragraf penutup', 'Paragraf pembuka, paragraf isi, paragraf penutup, dan salam penutup\n', 'Paragraf pembuka dan paragraf isi', 'Salam pembuka, paragraf pembuka, paragraf isi, paragraf penutup\n', 'B', '', '', '', '', '', '', ''),
	(1043, 27, 6, 'Bacalah iklan lowongan pekerjaan berikut! <br>\nPT ELANG NUSANTARA Membutuhkan tenaga pembukuan Syarat: <br>\n1. Sarjana Akuntansi <br>\n2. Pengalaman minimal 1 tahun <br>\n3. Domisili Jakarta Lamaran ke PT Elang Nusantara Jalan Sudirman 78, Jawa Timur<br><br>\n\nPembuka surat lamaran kerja yang paling tepat dan berkaitan dengan iklan di atas adalah ...  \n', 1, 'Bersama ini saya melamar pekerjaan sesuai dengan yang Bapak iklankan', 'Dengan ini saya mengajukan lamaran kerja', 'Berdasarkan iklan yang Bapak beritahukan, saya bermaksud melamar pekerjaan tersebut', 'Berdasarkan lowongan kerja yang Bapak iklankan untuk tenaga pembukuan, dengan ini saya mengajukan lamaran untuk mengisi lowongan kerja tersebut', 'Sesuai dengan iklan yang Bapak tawarkan, dengan ini saya bermaksud melamar pekerjaan tersebut\n', 'E', '', '', '', '', '', '', ''),
	(1044, 27, 7, 'Cermati kalimat di bawah ini!<br>\nSurat lamaran pekerjaan tidak memiliki format yang resmi..., surat lamaran pekerjaan memiliki aturan-aturan yang harus diperhatikan dalam penulisannya.\n<br><br>\nKonjungsi (kata sambung) yang tepat untuk mengisi bagian yang rumpang (kosong) adalah?\n', 1, 'meskipun demikian', 'selanjutnya', 'akan tetapi', 'dengan demikian', 'oleh sebab itu\n', 'A', '', '', '', '', '', '', ''),
	(1045, 27, 8, 'Cermatilah kalimat surat balasan lamaran berikut!\nAnda ditunggu kehadirannya untuk tes tulis dan wawancara pada hari Senin, 15 Juli 2019 jam 08.00 WIB.\n<br><br>\nPerbaikan surat balasan lamaran pekerjaan tersebut yang santun adalah.\n', 1, 'Selamat! Anda ditunggu ya pada hari Senin, 15 Juli 2019 jam 08.00 untuk melakukan tes tulis dan wawancara.', 'Selamat! Anda lulus tes administrasi. Ditunggu kehadirannya pada hari Senin, 15 Juli 2019 jam 08.00 untuk melakukan tes tulis dan wawancara.', 'Berdasarkan surat lamaran yang Saudara kirim, Saudara dinyatakan lulus seleksi administrasi. Ditunggu kehadirannya pada hari Senin, 15 Juli 2019 pukul 08.00 WIB untuk melakukan tes tulis dan wawancara.', 'Berdasarkan surat lamaran yang Anda kirim, Anda ditunggu pada hari Senin, 15 Juli 2019 jam 08.00 untuk melakukan tes tulis dan wawancara.', 'Anda ditunggu pada hari Senin, 15 Juli 2019 jam 08.00 untuk melakukan tes tulis dan wawancara.', 'C', '', '', '', '', '', '', ''),
	(1046, 27, 9, 'Saya lulusan SMK program keahlian Teknik Permesinan tahun 2017 mengajukan lamaran agar diterima sebagai operator produksi. Saya dapat mengoprassikan mesin bubut, gerinda duduk, dan frais. <br>\nPenggalan surat lamaran pekerjaan di atas berisikan hal berikut, kecuali ... ', 1, 'Tujuan penyampaian surat lamaran pekerjaan', 'Pemberitahuan keterampilan tambahan yang dikuasai', 'Penyebutan jabatan yang diminati', ' Alasan pengajuan surat lamaran pekerjaan', 'Pemberitahuan mengenai program keahlian yang dimiliki \n', 'A', '', '', '', '', '', '', ''),
	(1047, 27, 10, 'Cermati iklan lowongan berikut! \nPerusahaan yang sedang berkembang membutuhkan kepala bagian iklan S1, berbahasa Inggris aktif, maksimal 27 tahun, mampu mengoperasikan komputer, berpengalaman dalam bidang advertising, siap bekerja keras memajukan perusahaan.<br> Sumber : Harian Semar 9 Mei 2018<br>\nKalimat yang menyatakan isi surat lamaran pekerjaan dengan tepat sesuai ilustrasi di atas adalah ...', 1, 'Berdasarkan iklan lowongan pekerjaan di Harian Semar, 9 Mei 2018 tentang bagian kepala iklan, saya bermaksud untuk melamar pekerjaan diperusahaan', 'Sehubungan dengan iklan lowongan pekerjaan di Harian Semar, 9 Mei 2018 lamaran pekerjaan sebagai kepala saya mengajukan bagian iklan di perusahaan bapak, mohon diterima ', 'Sehubungan dengan iklan Bapak di Harian Semar, 9 Mei 2018 mengharapkan agar Bapak menerima saya sebagai kepala iklan di perusahaan Bapak', 'Berdasarkan iklan lowongan pekerjaan di Harian Semar, membutuhkan bagian iklan', 'Saya yang bertanda tangan di bawah ini, Rika Farida, 26 tahun, D3 Akuntansi, siap dilatih mengoperasikan komputer dan dilatih bahasa Inggris aktif', 'A', '', '', '', '', '', '', ''),
