	(1283, 33, 27, 'Bioteknologi adalah istilah yang berasal dari bahasa latin yang terdiri atas kata bio yang berarti â€œhidupâ€ dan teknos yang berarti â€œteknologiâ€ serta logos yang berarti â€œilmu.â€ Selanjutnya bioteknologi diartikan sebagai kajian ilmu terapan yang konsen terhadap rangkaian proses biologis dalam rangka menghasilkan barang dan jasa yang menerapkan prinsip sains. Perkembangan bioteknologi tak hanya didasarkan pada cabang keimuan biologi saja, namun juga pada disiplin ilmu terapan lainnya semisal biologi molekuler, komputer, biokimia, genetika, kimia, mikrobiologis, matematika, dan lain sebagainya     Teks tentang bioteknologi di atas menggunakan pola pengembangan â€¦', 1, 'Contoh', 'Definisi', 'Klasifikasi', 'Kronologis', 'proses', 'B', '', '', '', '', '', '', ''),
