	(1302, 34, 10, 'Pahamilah wacana berikut dengan saksama! \nBendungan di Desa Jatirogo ini tidak ada duanya di Indonesia. Tubuh bendungan tersebut dari bantalan karet berisi air. Karena terbuat dari karet, tinggi permukaannya bisa diatur secara fleksibel. Bila terjadi banjir, bantalan karet itu dikempiskan. Dan air bah lancar mengalir ke laut. Sebaliknya, bila volume air sungai mengecil, tubuh bendungan diisi penuh, sehingga tingginya mencapai 3 m. Sungai terbendung dan airnya dimanfaatkan sebagai air minum dan irigasi. Pada saat yang sama, air pasang dari laut akan terhambat dan tak mencemari sungai yang menjadi sumber utama air tawar masyarakat di sekitar sungai. Simpulan isi wacana di atas adalah?', 1, 'Bendungan dari bantalan karet dapat membendung sungai.', 'Bendungan dari bantalan karet sangat bermanfaat.', 'Bendungan dari bantalan karet dapat mengalirkan air.', 'Pemanfaatan air melalui bendungan bantalan karet.', 'Bendungan bantalan karet dapat diisi dengan air.', 'B', '', '', '', '', '', '', ''),
	(1303, 34, 11, 'Pahamilah paragraf berikut dengan saksama! Produksi padi tahun 2005 diperkirakan mencapai 53, 01 juta ton gabah kering giling atau turun dua persen dibandingkan dengan produksi tahun sebelumnya. Hal ini disebabkan adanya penurunan luas panen padi sawah akibat bencana banjir dan kekeringan, serta pergeseran waktu tanam pada empat bulan pertama di tahun 2005. Kalimat utama paragraf di atas adalah?', 1, 'Produksi padi tahun 2005 diperkirakan menurun.', 'Produksi padi tahun 2005 diperkirakan mencapai 53, 01 juta ton gabah kering atau turun dua persen dari sebelumnya.', 'Adanya penyebab turunnya produksi padi, yaitu banjir dan kekeringan.', 'Produksi padi tahun 2005 lebih jelek dibandingkan tahun sebelumnya.', 'Produksi padi tahun 2005 turun akibat banjir, kekeringan, dan pergeseran waktu tanam.', 'B', '', '', '', '', '', '', ''),
	(1304, 34, 12, 'Pahamilah dengan seksama penggalan teks berikut ini!\nObjek wisata alam di Bantul membuat pengunjungnya berdecak kagum. Demikian pula dengan wisata alam buatan dan tempat-tempat bersejarah di kabupaten Bantul memiliki daya tarik bagi wisatawan. Pemandangan alam dan perbukitan yang menawan dengan bentangan pantai selatan yang berselimut mitos kecantikan Gusti Kanjeng Ratu Kidul adalah pesona tersendiri yang membuat wisatawan selalu berduyun-duyun datang ke wilayah selatan Bantul. Wisata alam Pantai Selatan masih menjadi tujuan kunjungan wisatawan di daerah itu karena memiliki pesona yang indah.  \n\nTujuan penulis dalam paragraf tersebut adalah?\n', 1, 'Mengimbau agar masyarakat melestarikan berbagai objek wisata di Bantul.', ' Menginformasikan banyaknya objek wisata yang dikunjungi wisatawan mancanegara.', 'Memberitahukan bahwa di kabupaten Bantul banyak objek wisata yang menarik.', 'Memastikan bahwa wisatawan yang ada di Kabupaten Bantul sangat banyak.', 'Memperlihatkan keindahan Pantai Selatan yang disukai banyak masyarakat.', 'C', '', '', '', '', '', '', ''),
