	(1330, 34, 1, '<p>Apa yang dimaksud dengan Teks Laporan Hasil Observasi?</p>', 1, '<p>Teks yang berisi langkah-langkah atau tahapan yang harus dilakukan untuk mencapai suatu tujuan.</p>', '<p>Teks yang menjelaskan sebab akibat suatu fenomena, baik itu peristiwa alam, ilmu pengetahuan, sosial, budaya, dan lainnya.</p>', '<p>Teks yang memberikan informasi secara umum tentang sesuatu berdasarkan fakta dari hasil pengamatan secara langsung di lapangan.</p>', '<p>Teks atau karangan yang terkandung sejumlah informasi dan pengetahuan yang disajikan secara singkat, padat, dan akurat.</p>', '<p>Teks yang menjelaskan dan menceritakan tentang fakta dan kejadian masa lalu yang menjadi latar belakang terjadinya sesuatu yang mempunyai nilai sejarah.</p>', 'C', '', '', '', '', '', '', ''),
	(1331, 34, 5, '<p>Pahamilah kutipan teks berikut ini! Bekam atau hijamah ialah sebuah teknik pengobatan yang dilakukan dengan jalan membuang darah kotor (racun yang berbahaya) dari dalam tubuh lewat permukaan kulit. Menurut pemahaman umum, sebenarnya bekam berfungsi untuk membang darah yang teah rusak atau teroksidasi karena tingginya oksidan dalam tubuh.&nbsp;Kutipan teks di atas termasuk salah satu struktur teks laporan hasil observasi, yaitu?</p>', 1, '<p>Pernayataan umum</p>', '<p>Anggota/aspek yang dilaporkan</p>', '<p>Kalimat opini</p>', '<p>Kalimat definisi</p>', '<p>Kalimat fakta</p>', 'A', '', '', '', '', '', '', ''),
	(1332, 34, 7, '<p>Pahamilah paragraf di bawah ini! Harimau dapat mencapai tinggi 1, 5 meter, panjang 3, 3 meter, dan berat 300 kiligram. Bulunya berwarna putih dan coklat keemasan dengan belang atau loreng berwarna hitam. Gigi taringnya kuat dan tajam untuk mengoyak daging. Kakinya berjumlah empat dengan cakar yang kuat untuk menerkam mangsanya. Teks laporan hasil observasi di atas berjenis apa?</p>', 1, '<p>definisi</p>', '<p>eksposisi</p>', '<p>klasifikasi</p>', '<p>deskripsi</p>', '<p>argumentasi</p>', 'D', '', '', '', '', '', '', ''),
	(1333, 34, 8, '<p>Pahamilah kalimat di bawah ini! Pelikan adalah burung yang terkenal dengan paruhnya yang memiliki kantung. Jenis kalimat apa pada contoh kalimat di atas?</p>', 1, '<p>kalimat klasifikasi</p>', '<p>kalimat deskripsi</p>', '<p>kalimat definisi</p>', '<p>kalimat imperatif</p>', '<p>kalimat perbandingan</p>', 'C', '', '', '', '', '', '', ''),
	(1334, 34, 9, '<p>Pahamilah kalimat di bawah ini! Paruhnya yang meruncing panjangnya bisa lebih dari 30 cm dan bagian sebelah atas memiliki ujung yang bengkok membentuk kait. Jenis kalimat apa pada contoh kalimat di atas?</p>', 1, '<p>kalimat klasifikasi</p>', '<p>kalimat deskripsi</p>', '<p>kalimat definisi</p>', '<p>kalimat imperatif</p>', '<p>kalimat perbandingan</p>', 'B', '', '', '', '', '', '', ''),
	(1335, 34, 13, '<p>Pahamilah wacana berikut dengan saksama!&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>Bendungan di Desa air. Karena terbuat dari karet, tinggi permukaannya bisa diatur secara fleksibel. Bila terjadi banjir, bantalan karet itu dikempiskan. Dan air bah lancar mengalir ke laut. Sebaliknya, bila volume air sungai mengecil, tubuh bendungan diisi penuh, sehingga tingginya mencapai 3 m. Sungai terbendung dan airnya dimanfaatkan sebagai air minum dan irigasi. Pada saat yang sama, air pasang dari laut akan terhambat dan tak mencemari sungai yang menjadi sumber utama air tawar masyarakat Jatirogo ini tidak ada duanya di Indonesia. Tubuh bendungan tersebut dari bantalan karet berisi di sekitar sungai. Manakan kalimat kompleks hipotaktik dari teks di atas?</p>', 1, '<p>Bendungan di Desa Jatirogo ini tidak ada duanya di Indonesia.</p>', '<p>Sungai terbendung dan airnya dimanfaatkan sebagai air minum dan irigasi.</p>', '<p>Tubuh bendungan tersebut dari bantalan karet berisi air.</p>', '<p>Karena terbuat dari karet, tinggi permukaannya bisa diatur secara fleksibel.</p>', '<p>Objek wisata alam di Bantul membuat pengunjungnya berdecak kagum.</p>', 'D', '', '', '', '', '', '', ''),
	(1336, 34, 14, '<p>Pahamilah dengan seksama penggalan teks berikut ini!</p>\n<p>Objek wisata alam di Bantul membuat pengunjungnya berdecak kagum. Demikian pula dengan wisata alam buatan dan tempat-tempat bersejarah di kabupaten Bantul memiliki daya tarik bagi wisatawan. Pemandangan alam dan perbukitan yang menawan dengan bentangan pantai selatan yang berselimut mitos kecantikan Gusti Kanjeng Ratu Kidul adalah pesona tersendiri yang membuat wisatawan selalu berduyun-duyun datang ke wilayah selatan Bantul. Wisata alam Pantai Selatan masih menjadi tujuan kunjungan wisatawan di daerah itu karena memiliki pesona yang indah.&nbsp;</p>\n<p>Manakan kalimat simpleks dari teks di atas?</p>', 1, '<p>Demikian pula dengan wisata alam buatan dan tempat-tempat bersejarah di kabupaten Bantul memiliki daya tarik bagi wisatawan.</p>', '<p>Pemandangan alam dan perbukitan yang menawan dengan bentangan pantai selatan yang berselimut mitos kecantikan Gusti Kanjeng Ratu Kidul adalah pesona tersendiri yang membuat wisatawan selalu berduyun-duyun datang ke wilayah selatan Bantul.</p>', '<p>Objek wisata alam di Bantul membuat pengunjungnya berdecak kagum.</p>', '<p>Wisata alam Pantai Selatan masih menjadi tujuan kunjungan wisatawan di daerah itu karena memiliki pesona yang indah</p>', '<p>Pada saat yang sama, air pasang dari laut akan terhambat dan tak mencemari sungai yang menjadi sumber utama air tawar masyarakat Jatirogo ini tidak ada duanya di Indonesia.</p>', 'C', '', '', '', '', '', '', ''),
