	(1338, 35, 1, 'Dear Rangga.<br>\nHi Rangga, Let me introduce myself. I am Michel Jacson, you can call me Laura, I am sixteen  years old. I come from Perth, Australia. Its quite close to Nusa Tenggara islands, precisely in the north part of Australia.  Would you like to be my friend?<br>\nWell, iam here to participate in the student exchange program and I attend SMK Persada Utama, Denpasar. It is a nice school and all the people there the participal, teachers, staff and schoolmates are very kind and helpful.\nI will stay here for about three months. During my stay, I’ll live with a local resident, the Affandi family. They are very nice and friendly people and treat me like one of the family. They help me a lot in adapting to the new culture and environment so I feel comfortable and welcome living here. I guess I will love this city.\nRegards,<br>\nLaura Smith<br><br>\n                                                                                                    1. How old is  Michel ?', 1, ' 16 years old', '15 years old', '6 years old', '70 years old', '20 years old', 'A', '', '', '', '', '', '', ''),
