	(1419, 36, 22, 'Burning a CD allows you to take music from one CD and transfer it onto another CD. This process is possible with any computer that has a CD driver, but it is easier on a computer that can run two CDs at once. Either way, you can copy all your music from one CD to the next. Here is how to copy from one CD to another, using one and two CD drivers.<br><br>\nInstructions burning with two CD Trays<br>\n1. Insert the CD from which you want to burn music into your computer’s CD tray. Insert a blank CD into your computer’s second CD tray.<br>\n2. Open windows media player and wait for it to recognize the CD.<br>\n3. Click the “burn” option at the top of Windows Media Player. Drag the songs you want from the list of your songs into the area on the right labeled “Burn List”.<br>\n4. Choose the blank CD onto which you want to burn your song. This can be done at the top of the Burn List Menu.<br>\n5. Click the “Start Burn” button when you have all the song you want for the CD added to the Burn List. Wait for your computer to finish the CD, then take both of the CDs out.<br><br>\n\nWhat is the topic of the text?\n', 1, 'Running two CDs', 'Opening Media Player', 'Copying a compact disc', 'Choosing the blank CD', 'Inserting the CD into computer', 'C', '', '', '', '', '', '', ''),
