	(1426, 36, 29, '1. Find the phone number. Like the website, the phone number to active the credit card will likely be on the card. It may also be in the paperwork with the card.<br>\n2. Have you information ready. You’ll likely need you credit card number, your account number, and the security code on the back of card. The account number should be with the information that came with the card. You may also need your social security number or your date of birth. You may be asked to give your full name.<br>\n3. Call the number. Once you dial the number, you will likely reach a recorded service. Follow the direction given by the system. You may to input information with the keypad, such as your credit card number or security code.\n4. Complete the process. Finish giving the system your information. Once you’ve given all the information, your card Will be activated.<br>\n5. Take off the sticker, and sign the card. Peel the sticker back from the card with the activation information on it. Add your signature to the back of the card.<br>\nTips<br>\n• If you have trouble, call costumer service, and click through until you get a live person. That person can talk to you through the process or active your card for you.<br><br>\n\nWhat is the most suitable topic for the text?', 1, 'How to make a credit card', 'How to make a telephone call', 'How to activate a credit card by phone', 'How to process credit card activation', 'How to activate phone cell', 'A', '', '', '', '', '', '', ''),
