	(1461, 37, 5, 'Orchard Road\n<br><br>\nOrchard Road is a Boulevard which becomes business and entertainment center in Singapore. Orchard Road is surrounded by a lush tropical and flower gardens B6which are beautiful. At first, Orchard Road is just a suburban street lined with orchards, plantations nutmeg, and pepper farming. However, in the 1970s, it turned into a shopping center in Singapore. In 1960 and 1970 entertainment industries began to enter this road. Shopping centers such as mall and Plaza was built in 1974.B17\n<br><br>\nOrchard Road runs along about 2.2 km. This road is one-way street flanked by a variety of shopping malls, hotels and restaurants. The shopping area which is nearly 800,000 square meters provides a wide range of Things, food, and entertainment. In this area there are many options that can satisfy visitors from all walks of life starting from the luxury branded things to the Popular branded, from exclusive restaurants to fast food.\n<br><br>\nThere are so many ways that can be accessed to get to Orchard road such as: by taxi, bus or drive your own car. For those who are driving to Orchard Road can be entered from the west throu+B6gh the Napier Road. Vehicles from Dunearn Road can turn to left at the intersection of the Marriott Hotel junction. Vehicles that come from Paterson can turn right onto Orchard Road. Orchard is always crowded so you have to be careful in order not to get lost.\n<br><br>\n5. Which statement is TRUE?\n', 1, 'At first Orchard Road is a crowded settlement', 'Orchard road became business and entertainment center since 1974', 'Vehicles from Dunrean road turn to the left at intersection of the Marriott Hotel junction', 'Orchard road is infamous place at Singapore', 'Orchard road is not surrounded by flower garden', 'C', '', '', '', '', '', '', ''),
