	(1463, 37, 9, 'This museum is located in Ambarawa in central Java. The museum focuses on the collection of steam locomotive. Ambarawa was a military city during the Dutch colonial government. King Willem I ordered the construction of the new railway station to enable the government to\ntransport it‟s troops to Semarang. On may the 21st 1873, the  Ambarawa railway station was built on 100,027,500 squares  meter  lanD.  Back  then  it was known as the Willem I station. The Ambarawa railway museum was established much later on October 16, 1976 in the Ambarawa station to preserve the steam locomotive.  They were coming to  the  end of their  useful life when the 3 feet 6 inches guard railway or the Indonesian state railway or Perusahaan Negara Kereta  Api  was  closed.  The  steam  locomotives  are parked in the open air next to the original station.<br><br>\n9. What was the Ambarawa called during the Dutch colonial government?\n', 1, ' A military city', ' A railway museum,', 'King Willem I station.', 'Steam locomotives station', 'A new railway town,', 'C', '', '', '', '', '', '', ''),
