	(1476, 37, 22, 'Taufik Hidayat quiting national badminton team after 13 years of service, which culminated in an Olympic gold medal, shuttler Taufik Hidayat announced Friday his resignation from the national training camp in Jakarta.<br>\n“My decision to resign is final. It’s not an impulse or emotional decision. I’ve been thinking about quitting the national team since 2004, after I won at the Athens Olympics,” he saiD. “However, people kept on encouraging me to stay in the national team, considering my potential and my youth. Therefore I stayed until 2008.” In 2001, Taufik threatened to quit the training camp because of Mulyo’s exclusion. Mulyo is his mentor. He only joined the national team after the head of PBSI Djoko Santoso has agreed to restore Mulyo. In 2004, Taufik made yet another threat to quit, and again backed down from it. “It’s time for younger players to take the baton. I’m giving way to them.<br>\nIt’s all about regeneration in Indonesian badminton,” he said ( By kompas.com 2008 )<br><br>\n22.How many years Taufik Hidayat played badminton with the national team …', 1, '14 years', '15 years', '2008', '13 years', 'until now', 'D', '', '', '', '', '', '', ''),
