	(1485, 37, 4, '<p>Orchard Road</p>\n<p>Orchard Road is a Boulevard which becomes business and entertainment center in Singapore. Orchard Road is surrounded by a lush tropical and flower gardens which are beautiful. At first, Orchard Road is just a suburban street lined with orchards, plantations nutmeg, and pepper farming. However, in the 1970s, it turned into a shopping center in Singapore. In 1960 and 1970 entertainment industries began to enter this road. Shopping centers such as mall and Plaza was built in 1974.</p>\n<p>Orchard Road runs along about 2.2 km. This road is one-way street flanked by a variety of shopping malls, hotels and restaurants. The shopping area which is nearly 800,000 square meters provides a wide range of Things, food, and entertainment. In this area there are many options that can satisfy visitors from all walks of life starting from the luxury branded things to the Popular branded, from exclusive restaurants to fast food.</p>\n<p>There are so many ways that can be accessed to get to Orchard road such as: by taxi, bus or drive your own car. For those who are driving to Orchard Road can be entered from the west through the Napier Road. Vehicles from Dunearn Road can turn to left at the intersection of the Marriott Hotel junction. Vehicles that come from Paterson can turn right onto Orchard Road. Orchard is always crowded so you have to be careful in order not to get lost.</p>\n<p>4. The text mainly focuses on ...</p>', 1, '<p>Singapore</p>', '<p>Orchard Plantation</p>', '<p>Plaza and Mall</p>', '<p>Orchard road as business and entertainment center</p>', '<p>Shopping Center</p>', 'D', '', '', '', '', '', '', ''),
